    $b0           = a * ((a + 1.) + (a - 1.) * cos_w0 + sqrta2alpha) * inv_a0;
    $b1           = -2. * a * ((a - 1.) + (a + 1.) * cos_w0) * inv_a0;
    $b2           = a * ((a + 1.) + (a - 1.) * cos_w0 - sqrta2alpha) * inv_a0;
