  double init$gain_window_tapered (double x)
  {
    return 0.5 - 0.5 * std::cos (x * 2. * 3.141592653589793);
  }
  //----------------------------------------------------------------------------
  double init$shift_filters_down (double filter_mem)
  {
    double i            = 0.;
    double filter_mem_i = 0.;
    i                   = band_count * 14. - 1.;
    while (i >= 14.) {
      heap (filter_mem + i) = heap (filter_mem + (i - 14.));
      i -= 1.;
    }
    bw = filter_width_factor
      * (std::log (high_freq / low_freq) / std::log (2.) / band_count);
    init$filter_band (
      low_freq,
      1.,
      bw,
      target_filter$a1,
      target_filter$a2,
      target_filter$b0,
      target_filter$b1,
      target_filter$b2);
    init$filter_band (
      low_freq,
      1.,
      bw,
      shift_down_new_filter$a1,
      shift_down_new_filter$a2,
      shift_down_new_filter$b0,
      shift_down_new_filter$b1,
      shift_down_new_filter$b2);
    filter_mem_i              = filter_mem;
    heap (filter_mem_i)       = target_filter$a1;
    heap (filter_mem_i + 2.)  = target_filter$a2;
    heap (filter_mem_i + 4.)  = target_filter$b0;
    heap (filter_mem_i + 6.)  = target_filter$b1;
    heap (filter_mem_i + 8.)  = target_filter$b2;
    heap (filter_mem_i + 12.) = heap (filter_mem_i + 10.);
    heap (filter_mem_i + 13.) = heap (filter_mem_i + 11.);
    return heap (filter_mem_i + 13.);
  }
  //----------------------------------------------------------------------------
  double init$shift_filters_up (double filter_mem)
  {
    double i            = 0.;
    double filter_mem_i = 0.;
    double bw           = 0.;
    i                   = 0.;
    while (i < (band_count - 1.) * 14.) {
      heap (filter_mem + i) = heap (filter_mem + (i + 14.));
      i += 1.;
    }
    bw = filter_width_factor
      * (std::log (high_freq / low_freq) / std::log (2.) / band_count);
    init$filter_band (
      high_freq,
      1.,
      bw,
      target_filter$a1,
      target_filter$a2,
      target_filter$b0,
      target_filter$b1,
      target_filter$b2);
    filter_mem_i              = filter_mem + (band_count - 1.) * 14.;
    heap (filter_mem_i)       = target_filter$a1;
    heap (filter_mem_i + 2.)  = target_filter$a2;
    heap (filter_mem_i + 4.)  = target_filter$b0;
    heap (filter_mem_i + 6.)  = target_filter$b1;
    heap (filter_mem_i + 8.)  = target_filter$b2;
    heap (filter_mem_i + 12.) = heap (filter_mem_i + 10.);
    heap (filter_mem_i + 13.) = heap (filter_mem_i + 11.);
    return heap (filter_mem_i + 13.);
  }
