  //----------------------------------------------------------------------------
  double init$sinh (double x)
  {
    double e_x = 0.;
    return [&] {
      if (x > 20.) {
        return (std::exp (x) * 0.5);
      }
      else {
        return [&] {
          if (x < -20.) {
            return (-0.5 * std::exp (-x));
          }
          else {
            e_x = std::exp (x);
            return (e_x - 1. / e_x) * 0.5;
          }
        }();
      }
    }();
  }
